# func find_consonant_substrings return list of strings, for each string
# included in the original string str_arg
# begin consonant char
def find_consonant_substrings(str_arg):
    consonants_str = 'BCDFGHJKLMNPQRSTVWXZY'
    substrings_list = []
    index_start = 0
    index_end = None
    str_len = len(str_arg)
    while index_start < str_len:
        if str_arg[index_start] in consonants_str:
            for index_end in range(len(str_arg[index_start:])):
                substrings_list.append(str_arg[index_start:index_start+index_end+1])
            index_start += 1
        else:
            index_start += 1
            continue
    return substrings_list


