def check_only_one_char(arg_str):
    first_char = arg_str[0]
    for c in arg_str:
        if c != first_char:
            return False
    return True


def score_flat_string(len_of_string):
    score = 0
    if len_of_string%2 == 0:
        score = int(len_of_string*(len_of_string/2)+len_of_string/2)
    else:
        score = int((len_of_string*len_of_string/2)+(len_of_string+1)/2)

    return score


# print Name of winner, his score
def minion_game(string):
    vowels_str = 'AEIOU'
    consonants_str = 'BCDFGHJKLMNPQRSTVWXZY'

    kevin_vowels_score = 0
    stuart_consonants_score = 0

    if check_only_one_char(string):
        if string[0] in consonants_str:
            stuart_consonants_score = score_flat_string(len(string))
        elif string[0] in vowels_str:
            kevin_vowels_score = score_flat_string(len(string))
    else:
        stuart_consonants_score = score_consonant_substrings(string)
        kevin_vowels_score = score_vowel_substrings(string)

    if stuart_consonants_score > kevin_vowels_score:
        print('Stuart', stuart_consonants_score)
    elif kevin_vowels_score > stuart_consonants_score:
        print('Kevin', kevin_vowels_score)
    else:
        print('Draw')


